import React from "react";

class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      main: "Main",
      servise: "Servise",
      forAs: "For as",
      contact: "Contact",

      action: "",
    };
  }

  render() {
    return (
      <div>
        <header>
          <div onClick={() => this.setState({ action: [this.state.main] })}>
            {this.state.main}
          </div>
          <div onClick={() => this.setState({ action: [this.state.servise] })}>
            {this.state.servise}
          </div>
          <div onClick={() => this.setState({ action: "For as" })}>
            {this.state.forAs}
          </div>
          <div onClick={() => this.setState({ action: "Contact" })}>
            {this.state.contact}
          </div>
        </header>
        <div>Selected: {this.state.action}</div>
      </div>
    );
  }
}
export default App;
